    .hero{
        padding-top: 0;
    }
    .hero__content{
        text-align: left;
        align-self: center;
    }
}

/* Domain Block */

.block-domain .input-group{
    box-shadow: 0 0 30px 20px #e6ebee;
    border: 0;
    margin: 4rem auto;
    max-width: 670px;

}

.block-domain__prices{
    color: var(--color-headings);
    display: grid;
    grid-template-columns: repeat(2,1fr);
    grid-template-rows: repeat(2, 6rem);
    font-size: 2rem;
    font-weight: 600;
    justify-items: center;
    max-width: 700px;
    margin: 0 auto;
}

@media screen and (min-width: 768px){
    .block-domain__prices{
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
    }
}


/* Plains Block*/

.block-plans .grid{
    gap: 8rem 4rem;
}

.block-plans .card {
    max-width:  500px;
    margin: 0 auto;
}



/* features */
.feature{
    gap: 4rem 2rem;
    margin: 12rem 0;
}

.feature:first-of-type{
    margin-top: 6rem;
}

.feature__heading{
    margin: 1rem 0;
}

.feature__image{
    width: 100%;
}


@media screen and (min-width: 768px){

    .feature:nth-of-type(even) .feature__content {
        order:2;
    }

}

/* Block showcase */

.block-showcase__image > img{
    width:100%;
}

@media screen and (min-width: 768px){
    .block-showcase .grid{
        grid-template-columns: 50% 50%;
    }
    .block-showcase__image{
        justify-self: end;
    }

    .block-showcase__image > img{
        width: auto;
        max-width: 700px;
    }
}

/* Footer block */

.footer{
    background: #232323;
}

.footer a{
    color: #777;
    transition: color 0.3s;
}

.footer a:hover{
    color:#fff;
}

.footer__section{
    padding: 2rem;
    border-bottom: 1px solid #393939;
}

.footer__section .list{
    margin: 0;
}

.footer__heading{
    text-transform: uppercase;
    font-weight: 600;
}

.footer__brand{
    margin-top: 5rem;
    text-align: center;
}
/* TODO: Consider refactoring this and applying it to all images */
.footer__brand img {
    width: 100%;
}

.footer__copyright{
    font-size: 2.1rem;
    color: #fff;
    opacity: .3;
}

@media screen and (min-width: 768px) {
    .footer__sections {
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
    }

    .footer .collapsible__chevron{
        display:none;
    }

    .footer .collapsible__content{
        opacity: 1;
        max-height: 100%;
    }

    .footer__brand{
        order: -1;
        margin-top: 1rem;
    }

    .footer__copyright{
        font-size: 1.5rem;
    }

    .footer__section{
        border: 0;
    }

    .footer__heading{
        font-size: 1.6rem;
    }
}

